Certainly! Below is a Python script that takes two functions as input and calculates the Average Rate of Change (ROC) using the formula \( A(x) = \frac{f(b) - f(a)}{b - a} \).

```python
def get_function(name):
    """
    Get the function f(x)
    """
    def f(x):
        raise NotImplementedError(f"The function {name} is not implemented yet.")

    try:
        def f(x):
            return eval(name)(x)
        return f
    except NameError:
        return None

def average_rate_of_change(f, a, b):
    """
    Calculate the Average Rate of Change of a function f at points a and b.
    """
    return (f(b) - f(a)) / (b - a)

def main():
    print("Enter the name of the function:")
    name = input("f(x): ")

    if not get_function(name):
        print("The function {} is not implemented.".format(name))
        return

    try:
        a = float(input("Enter the value of x at point a: "))
        b = float(input("Enter the value of x at point b: "))
    except ValueError:
        print("Invalid input. Please enter numeric values.")
        return

    f = get_function(name)
    if not f:
        print("Could not evaluate the function.")
        return

    roc = average_rate_of_change(f, a, b)
    if roc is None:
        print("The function did not have a defined value at the given points.")
    else:
        print(f"The Average Rate of Change at points {a} and {b} is: {roc}")

if __name__ == "__main__":
    main()
```

### Explanation:
1. **`get_function(name)`**: This function returns the function `f(x)` based on its name. It raises a `NotImplementedError` if the function is not defined.
2. **`average_rate_of_change(f, a, b)`**: This function calculates the Average Rate of Change using the formula \( A(x) = \frac{f(b) - f(a)}{b - a} \).
3. **`main()`**: This is the main function that prompts the user to input the function name, the value of `a`, and the value of `b`. It then evaluates the function and calculates the Average Rate of Change.

### Usage:
1. Run the script.
2. Input the name of the function (e.g., `f(x) = x^2`).
3. Input the value of `a` and `b`.
4. The script will output the Average Rate of Change at points `a` and `b`.

Please note that the script uses `eval()` to dynamically evaluate the function name. This can be dangerous if the user inputs a malicious function name. In a production environment, you should validate the input more robustly.

