Here's a basic implementation in C using ASCII characters:

```c
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <time.h>

#define WIDTH 20
#define HEIGHT 10

typedef struct {
    int x, y;
    int length;
} Snake;

// Define possible directions
