int possible_directions[4] = {0, 1, 2, 3};

// Function to initialize the game board
void initialize_game() {
    int board[HEIGHT][WIDTH] = {0};
    for (int i = 0; i < HEIGHT; i++) {
        for (int j = 0; j < WIDTH; j++) {
            board[i][j] = '#';
        }
    }
}

// Function to print the game board
void print_board() {
    for (int i = 0; i < HEIGHT; i++) {
        for (int j = 0; j < WIDTH; j++) {
            if (i == 0 && j == 0) {
                printf("|");
            } else {
                printf(" " + board[i][j]);
            }
        }
        printf("\n");
    }
}

// Function to check for collisions
void check_collision() {
    int head_x = length - 1;
    int head_y = length - 1;

    for (int direction = 0; direction < 4; direction++) {
        int move_x = head_x + dir[direction] * 2;
        int move_y = head_y + dir[direction] * 2;

        if (move_x >= WIDTH || move_x < 0 || move_y >= HEIGHT || move_y < 0) {
            return;
        }

        if (board[head_y + dir[direction]][head_x + dir[direction]] == '#') {
            return;
        }

        if (board[head_y + dir[direction]][head_x + dir[direction]]!= '#') {
            return;
        }
    }
}

// Function to update the snake
void update_snake() {
    int new_head_x = head_x;
    int new_head_y = head_y;

    for (int direction = 0; direction < 4; direction++) {
        int move_x = new_head_x + dir[direction] * 2;
        int move_y = new_head_y + dir[direction] * 2;

        if (move_x >= WIDTH || move_x < 0 || move_y >= HEIGHT || move_y < 0) {
            new_head_x = head_x;
            new_head_y = head_y;
            break;
        }

        if (board[move_y + dir[direction]][move_x + dir[direction]] == '#') {
            new_head_x = head_x;
            new_head_y = head_y;
            break;
        }
    }

    head_x = new_head_x;
    head_y = new_head_y;
}

// Function to handle input and update the snake
void handle_input() {
    int key = getchar();
    switch (key) {
        case 'w': if (head_x > 0) dir[0] = 0; break;
        case's': if (head_x < WIDTH - 1) dir[0] = 0; break;
        case 'a': if (head_y > 0) dir[1] = 0; break;
        case 'd': if (head_y < HEIGHT - 1) dir[1] = 0; break;
    }

    // Update the snake
    update_snake();
}

int main() {
