```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <algorithm>

int countWordOccurrences(const std::string& line, const std::string& word) {
    int count = 0;
    size_t pos = line.find(word, 0);

    while (pos!= std::string::npos) {
        count++;
        pos = line.find(word, pos + word.length());
    }

    return count;
}

int main() {
    std::string filename;
    std::string word;

    std::cout << "Enter the filename: ";
    std::cin >> filename;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Could not open the file " << filename << std::endl;
        return 1;
    }

    int totalCount = 0;
    std::string line;
    while (std::getline(file, line)) {
        totalCount += countWordOccurrences(line, word);
    }

    file.close();

    std::cout << "The word \"" << word << "\" occurred " << totalCount << " times in the file." << std::endl;

    return 0;
}
```

